import * as React from 'react';
import { Button, View, StyleSheet, Text } from 'react-native';
import { Video } from 'expo-av';

const Home = ({ navigation }) => {
  const video = React.useRef(null);
  const [status, setStatus] = React.useState({});

  return (
    <View style={styles.container}>

      <Video
        ref={video}
        source={{
          uri: 'https://vod-progressive.akamaized.net/exp=1642088218~acl=%2Fvimeo-prod-skyfire-std-us%2F01%2F2775%2F21%2F538877060%2F2554448071.mp4~hmac=969360c0533f0a69d3d49305747214679d8ff9205abb0b8439474ebccec32ade/vimeo-prod-skyfire-std-us/01/2775/21/538877060/2554448071.mp4?filename=Waves+-+70796.mp4',
        }}
        style={styles.backgroundVideo}
        rate={1}
        shouldPlay={true}
        isLooping={true}
        volume={1}
        isMuted={true}
        resizeMode="cover"
      />
      <Button title="Go back" onPress={() => navigation.goBack()} />
      <View style={styles.buttons}>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    backgroundColor: '#ecf0f1',
  },
  backgroundVideo: {
    flex: 1,
    top: 0,
    left: 0,
    bottom: 0,
    right: 0,
  },
});

export default Home;
